node.text:
Fascinante encontrar hermanos venezolanos que en cada rincón de este planeta a donde han llegado se abren camino en luz y humildad sirviendo al mundo y siendo fuente de amor. Gracias Esperanza y si hijo Eladio por tanto amor al recibirme y regalarme la tarta de Santiago. Y a ti te pregunto . Que te sorprende de viajar ??? Que te asombra?

@o25dofranco

@dieguez1992

